using System;
using Microsoft.VisualStudio.TestTools.UnitTesting;
using NewYearChaos;

namespace TestProject
{
    [TestClass]
    public class UTNewYearChaos
    {
        [TestMethod]
        public void TestMethod1()
        {
            int[] q = new int[] { 2, 1, 5, 3, 4 };

            string result = Program.minimumBribes(q);
            string expected = "3";

            Assert.AreEqual(expected, result);
        }

        [TestMethod]
        public void TestMethod2()
        {
            int[] q = new int[] { 2, 5, 1, 3, 4 };

            string result = Program.minimumBribes(q);
            string expected = "Too chaotic";

            Assert.AreEqual(expected, result);
        }

        [TestMethod]
        public void TestMethod3()
        {
            int[] q = new int[] { 5, 1, 2, 3, 7, 8, 6, 4 };

            string result = Program.minimumBribes(q);
            string expected = "Too chaotic";

            Assert.AreEqual(expected, result);
        }

        [TestMethod]
        public void TestMethod4()
        {
            int[] q = new int[] { 1, 2, 5, 3, 7, 8, 6, 4 };

            string result = Program.minimumBribes(q);
            string expected = "7";

            Assert.AreEqual(expected, result);
        }

        [TestMethod]
        public void TestMethod5()
        {
            int[] q = new int[] { 1, 2, 5, 3, 4, 7, 8, 6 };

            string result = Program.minimumBribes(q);
            string expected = "4";

            Assert.AreEqual(expected, result);
        }

